css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.travis-ci-status .build-status {
  cursor: pointer;
}
.travis-ci-status .build-matrix .builds {
  padding-left: 20px;
}
.travis-ci-status .icon:before {
  font-size: 14px;
  width: 14px;
  height: 14px;
  position: relative;
  top: 1px;
  margin-right: 0px;
}
.pending {
  color: #bf9555;
}
.success {
  color: #509e6a;
}
.fail {
  color: #d73a1e;
}
